import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Dishes(props) {

return(
      <div class="card" style={{width: "18rem;"}}>
      <img src={props.src} class="card-img-top" alt="dish-img" />
      <div class="card-body">
       <h5 class="card-title">{props.title}</h5>
       <p class="card-text">{props.ingrediants}</p>
       </div>
       <ul class="list-group list-group-flush">
       <li class="list-group-item">{props.price}</li>
       <li class="list-group-item">{props.description}</li>
       <li class="list-group-item">{props.category}</li>
       </ul>
       <div class="card-body">
       <button type="button" class="btn btn-outline-primary">Add</button>
       <button type="button" class="btn btn-outline-primary">Edit</button>
       </div>
       </div>
)
}

export default Dishes;
